import styles from "./Home.module.css";

const Home = () => {
  useEffect(() => {
    if (!authState) {
      console.log("User not authorized");
    }
  }, []);

  return (
    <div>
      <Header />
      <SideNav />
      <Footer />
    </div>
  );
};

export default Home;
